ISLAMABAD, Nov 29 (APP): Governor Balochistan Sheikh Jaffar Khan Mandokhail Friday called on Deputy Prime Minister and Foreign Minister Mohammad Ishaq Dar and discussed matters related to mutual interests.
During the meeting, they also discussed matters of the Balochistan province, a press release issued by the Deputy PM Office.
